import "./css/App.css";
import styled from "styled-components";
import { Sudoku } from "./components/Sudoku.js";
//import { colors } from "./colors.js";

function App() {
  return (
    <StyledDiv>
      <div className="App-header">
        <Sudoku></Sudoku>
      </div>
    </StyledDiv>
  );
}

const StyledDiv = styled.div`
  display: grid;
`;

export default App;
